اس پرامپٹ کا استعمال کرتے ہوئے اپنے C/C++ پروگراموں کو CHATGPT میں چلائیں۔ Chatgpt کا استعمال کرتے ہوئے اپنے ویب براؤزر میں تمام قسم کی کوڈنگ زبانوں کو براہ راست چلانے کے لیے یہ ایک بہت ہی طاقتور پرامپٹ ہے۔

 بس اپنا C یا C++ کوڈ ٹائپ کریں جسے آپ پرامپٹ میں چلانا چاہتے ہیں اور Chat-GPT آپ کو جواب میں اس پروگرام کا آؤٹ پٹ دے گا۔

 یہ مفید ہے اگر آپ کے کمپیوٹر میں کمپائلر انسٹال نہیں ہے اور اب آپ کچھ کوڈ کی جانچ کرنا چاہتے ہیں تو آپ اسے سادہ پرامپٹ سے کر سکتے ہیں۔

